package com.hackerrank.string;

import java.util.Deque;
import java.util.LinkedList;

public class MorganAndString {

    public static void main(String[] args) {
        System.out.println(morganAndString("",
            "\n"
                + "\n"
                + "\n"
                + "\n"
                + "\n"
                + "\n"
                + "\n"
                + "\n"
                + ""));
    }

    static String morganAndString(String a, String b) {
        StringBuilder resultant = new StringBuilder();
        Deque<Character> stackA = getStack(a);
        Deque<Character> stackB = getStack(b);
        while(!(stackA.isEmpty() || stackB.isEmpty())){

            if(stackA.peekFirst() < stackB.peekFirst()){
                resultant.append(stackA.pop());
            } else if (stackA.peekFirst() == stackB.peekFirst()){
                Character c1 = stackA.pop();
                Character c2 = stackA.pop();
                if(stackA.peekFirst() < stackB.peekFirst()){
                    stackB.addFirst(c2);
                    resultant.append(c1);
                } else {
                    stackB.addFirst(c2);
                    resultant.append(c2);
                }
            } else {
                resultant.append(stackB.pop());
            }
        }
        while(!stackA.isEmpty()){
            resultant.append(stackA.pop());
        }
        while(!stackB.isEmpty()){
            resultant.append(stackB.pop());
        }
        return resultant.toString();
    }

    private static Deque<Character> getStack(String a) {
        Deque<Character> deque = new LinkedList<>();
        char[] characters = new char[a.length()];
        a.getChars(0,a.length(), characters, 0);
        for (int i = 0; i < characters.length; i++) {
            deque.addLast(characters[i]);
        }
        return deque;
    }
}
